def find_motif(seq,t):
    starts = []
    for i in range(len(seq)-len(t)):
        if t == seq[i : (i+len(t))]:
            starts.append(i+1)
    return starts
            
# seq = 'GATATATGCATATACTT'
# t = 'ATAT'

seq = ''
t = 'AGCAACAAG'

ans = find_motif(seq, t)

s = ''
for a in ans:
    s += str(a) + ' '
    
print(s)